    function getFilteredPathname() {
        const search = window.location.search;

        if (!search.length) {
            return window.location.pathname;
        }

        const piiRegex = [
            {
                name: 'EMAIL',
                regex: /[^\/]{4}(@|%40)(?!printful\.com)[^\/]{4}/gi,
                group: ''
            },
            {
                name: 'SELF-EMAIL',
                regex: /[^\/]{4}(@|%40)(?=printful\.com)[^\/]{4}/gi,
                group: ''
            },
            {
                name: 'NAME',
                regex: /((firstname=)|(lastname=)|(surname=)|(fullName=))[^&\/?]+/gi,
                group: '$1'
            },
            {
                name: 'TEL',
                regex: /((tel=)|(telephone=)|(phone=)|(mobile=)|(mob=))[\d+\s][^&\/?]+/gi,
                group: '$1'
            },
            {
                name: 'PASSWORD',
                regex: /((password=)|(passwd=)|(pass=))[^&\/?]+/gi,
                group: '$1'
            },
            {
                name: 'ZIP',
                regex: /((postcode=)|(zipcode=)|(zip=))[^&\/?]+/gi,
                group: '$1'
            }
        ];

        const searchParams = search.replace(/(^\?)/, '').split("&");

        for (const paramKey in searchParams) {
            for (const regKey in piiRegex) {
                const val = decodeURIComponent(searchParams[paramKey]);
                const pii = piiRegex[regKey];

                if (val.match(pii.regex)) {
                    searchParams[paramKey] = encodeURIComponent(val.replace(pii.regex, pii.group + '[REDACTED_' + pii.name + ']'));
                    break;
                }
            }
        }

        return window.location.pathname + '?' + searchParams.join('&');
    }

